      - type: RubberStamp
        stampedColor: '#C69B17FF'
        stampedName: TB Engineering
      content: >2-

        [head=2]Quick guide to setting up atmospherics[/head]


        [bold]Step 1:[/bold] Set Oxygen and Nitrogen pumps to maximum pressure, and turn them on.

        [bold]Step 2:[/bold] Set Air mixer to 22% Primary Port, 78% Side Port, set it to maximum pressure, and turn it on.

        [bold]Step 3:[/bold] Verify air mixture with a gas analyzer. Ensure mixture is 22% oxygen, 78% nitrogen. 

        [bold]Step 4:[/bold] Set Distro pump to 300-500kpa, and turn it on.

        [bold]Step 5:[/bold] Set Distro heater to 293.15 kelvin, and turn it on.

        [bold]Step 6:[/bold] Set Waste pump to maximum pressure, and turn it on.

        [bold]Step 7:[/bold] Set Plasma and Carbon Dioxide filter to their coresponding gasses, set them to maximum pressure and turn them on.


        [head=3]General tips[/head]

        [bold]Use your gas analyzer:[/bold] The gas analyzer can diagone a variety of issues, such as incorrect mixes or hazardous environments. Use it.


        [bold]Use your holofan:[/bold] If unsure about the status of a room you are about to enter, place a holofan to prevent the flow of gas into the room. This can be the difference between a space station and a spaced station.


        [bold]Vent unsafe gasses:[/bold] If you're cleaning up after a fire, leak or other hazard, it can sometimes be best to space the room entirely. Use an RCD to deconstruct the floor and vent all the gasses, then replace it to refill the room with fresh air.


        [bold]"Space Heater' is a misnomer:[/bold] Space heaters can be used to heat and cool an area to an appropriate temperature. If the temperature is too extreme for a space heater, refer to the previous tip.


        [bold]Use portable scrubbers:[/bold] The portable scrubber is far more powerful than the regular scrubbers, and can be used to clear up huge amounts of dangerous gasses. If it's internal store isn't enough, build a connector port tied to the waste pipe network, and connect the scrubber directly to it.


        [bold]Use the fireaxe:[/bold] Beyond merely smacking tiders, the fireaxe can break down doors and walls, with some effort, which can be very useful in an emergency. It can also be used to smack tiders.
